import React, { Component } from 'react'

class main extends Component {
  constructor(props) {
    super(props)
  
    this.state = {
       mouseOver: 'You re over'
    }
  }
  
  onMouseOver = () => {
  this.setState(prevState =>{return {mouseOver: prevState.mouseOver + 'Over'}})}

  render() {
    return (
      <div>
        <input onMouseOver={this.onMouseOver}>{this.onMouseOver}</input>     
      </div>
    )
  }
}

export default main
